    "2015-11-05T05:52:54.902896",nt"name": "biodiversity-by-county-distribution-of-animals-plants-and-natural-communities",nt"isopen":
    false,nt"url": null,nt"notes": "The NYS Department of Environmental Conservation
    (DEC) collects and maintains several datasets on the locations, distribution and
    status of species of plants and animals. Information on distribution by county from
    the following three databases was extracted and compiled into this dataset.  First,
    the New York Natural Heritage Program biodiversity database: Rare animals, rare
    plants, and significant natural communities. Significant natural communities are
    rare or high-quality wetlands, forests, grasslands, ponds, streams, and other types
    of habitats.  Next, the 2nd NYS Breeding Bird Atlas Project database: Birds documented
    as breeding during the atlas project from 2000-2005.  And last, DECu2019s NYS Reptile
    and Amphibian Database: Reptiles and amphibians; most records are from the NYS Amphibian
    & Reptile Atlas Project (Herp Atlas) from 1990-1999.",nt"license_title": "License
